import {
    Box,
    Button,
    Card,
    CardActions,
    CardContent,
    Container,
    Grid,
    Typography,
    Dialog,
    List,
    ListItem,
    ListItemIcon,
    ListItemText,
    DialogTitle,
    DialogContent,
    DialogContentText,
    DialogActions,
    Divider,
  } from "@mui/material";

const Clients = () => {

  const companies = [
    {
      title:'Avicola',
      src:'images/avicola.jpeg'
    },
    {
      title:'Cantera San Miguel',
      src:'images/canteraSanMiguel.jpeg'
    },
    {
      title:'Cantera San Miguel',
      src:'images/ferreteria.jpeg'
    },
    {
      title:'Cantera San Miguel',
      src:'images/inmsas.jpeg'
    },
    {
      title:'Cantera San Miguel',
      src:'images/provi.jpeg'
    },
    {
      title:'Cantera San Miguel',
      src:'images/redSalud.jpeg'
    },
    {
      title:'Cantera San Miguel',
      src:'images/refriSur.jpeg'
    },
    {
      title:'Cantera San Miguel',
      src:'images/S.jpeg'
    },
  ]
  return (
    <Container sx={{ py: 6 }}>
      <Typography
        variant="h2"
        sx={{
          textAlign: "center",
          color: "#fff",
          mb: 4,
          fontWeight: "bold",
        }}
      >
        Clientes
      </Typography>
      <Grid container gap={1} justifyContent="space-around">
        {companies.map((item) => (
          <Grid item xs={12} md={1}>
            <Card elevation={5} sx={{width:125, display:"flex", alignItems:"center"}}>
                <Typography
                  sx={{ backgorund: "#f99f00", py:0.5 }}
                >
                 <img src={item.src} alt="" width="90%" style={{}}/>
                </Typography>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
};

export default Clients;
